import { useState } from "react";

const demo = Array.from(Array(20).keys());
const Earth = () => {
  const [creatures, setCreatures] = useState([]);
  return (
    <div style={{ backgroundColor: "#2C931D", height: "100%", width: "100%" }}>
      {demo.map(() => {
        return (
          <div
            style={{
              borderRadius: 5,
              height: 10,
              width: 10,
              backgroundColor: "#111111",
              position: "absolute",
            }}
          ></div>
        );
      })}
    </div>
  );
};

export default Earth;
